query:
DELETE FROM tactics WHERE goalId IN (
  SELECT g.id FROM goals g
  JOIN cycles c ON g.cycleId = c.id
  WHERE c.userId = 1 AND c.id != 60011 AND (c.title LIKE '%Test%' OR c.title LIKE '%Bulk%')
);

